  `fullname` varchar(128) DEFAULT NULL,
  `email` varchar(128) DEFAULT NULL,
  `phone` varchar(13) DEFAULT NULL,
  `role_id` int(11) DEFAULT NULL,
  `pict_profile` varchar(128) NOT NULL DEFAULT 'default.jpg',
