  `admin_menu` varchar(1) NOT NULL DEFAULT 'N',
  `updid` varchar(128) DEFAULT NULL,
  `updtime` datetime DEFAULT NULL,
  PRIMARY KEY (`username`),
  KEY `role_id` (`role_id`) USING BTREE,
  CONSTRAINT `tb_user_ibfk_1` FOREIGN KEY (`role_id`) REFERENCES `tb_user_role` (`role_id`) ON DELETE SET NULL ON UPDATE CASCADE
