/* Function  structure for function  `get_nama_toko` */

/*!50003 DROP FUNCTION IF EXISTS `get_nama_toko` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `get_nama_toko`(x VARCHAR(4)) RETURNS varchar(50) CHARSET utf8
    DETERMINISTIC
BEGIN DECLARE NAMA VARCHAR(50)  ;
select namatoko INTO NAMA from tb_toko where kodetoko=x ;
RETURN NAMA;
END */$$
DELIMITER ;

/* Function  structure for function  `get_user_name` */

/*!50003 DROP FUNCTION IF EXISTS `get_user_name` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `get_user_name`(nik VARCHAR(25)) RETURNS varchar(50) CHARSET utf8
    DETERMINISTIC
BEGIN DECLARE NAMA VARCHAR(50)  ;
select fullname INTO NAMA from tb_user where username=nik ;
RETURN NAMA;
END */$$
DELIMITER ;

